// HasDevice applies the HasEdge predicate on the "device" edge.
func HasDevice() predicate.TroubleDeduct {
	return predicate.TroubleDeduct(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, DeviceTable, DeviceColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDeviceWith applies the HasEdge predicate on the "device" edge with a given conditions (other predicates).
func HasDeviceWith(preds ...predicate.Device) predicate.TroubleDeduct {
	return predicate.TroubleDeduct(func(s *sql.Selector) {
		step := newDeviceStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.TroubleDeduct) predicate.TroubleDeduct {
	return predicate.TroubleDeduct(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.TroubleDeduct) predicate.TroubleDeduct {
	return predicate.TroubleDeduct(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.TroubleDeduct) predicate.TroubleDeduct {
	return predicate.TroubleDeduct(sql.NotPredicates(p))
}
